import React from 'react';

function App() {
  const goToAdminLoginn = () => {
    // Replace with real routing if needed
    alert('Redirecting to admin login...');
  };

  const headerStyle = {
    backgroundColor: '#f0f0f0',
    padding: '20px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
  };

  const titleStyle = {
    margin: 0,
    fontSize: '24px',
  };

  const logoStyle = {
    height: '60px',
    marginRight: '20px',
  };

  const adminStyle = {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: 'white',
    border: 'none',
    cursor: 'pointer',
    borderRadius: '4px',
  };

  const formContainerStyle = {
    padding: '30px',
    fontFamily: 'Arial, sans-serif',
  };

  const inputStyle = {
    width: '100%',
    padding: '8px',
    marginBottom: '10px',
  };

  const submitStyle = {
    padding: '10px 20px',
    backgroundColor: 'green',
    color: 'white',
    border: 'none',
    cursor: 'pointer',
    borderRadius: '4px',
  };

  return (
    <div>
      {/* Header */}
      <div style={headerStyle}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img
            src="https://akasainstitute.com/wp-content/uploads/2025/05/WhatsApp-Image-2025-04-25-at-9.31.43-PM.jpeg"
            alt="Logo"
            style={logoStyle}
          />
          <h1 style={titleStyle}>Akasa Institute</h1>
        </div>
        <button style={adminStyle} onClick={goToAdminLoginn}>
          Admin
        </button>
      </div>

      {/* Form */}
      <div style={formContainerStyle}>
        <form>
          <label>Register No:</label><br />
          <input type="text" name="regno" style={inputStyle} /><br />

          <label>Date:</label><br />
          <input type="date" name="date" style={inputStyle} /><br />

          <label>Phone:</label><br />
          <input type="tel" name="phone" style={inputStyle} /><br />

          <label>Email:</label><br />
          <input type="email" name="email" style={inputStyle} /><br />

          <label>Payment Purpose:</label><br />
          <input type="text" name="purpose" style={inputStyle} /><br />

          <label>Amount:</label><br />
          <input type="number" name="amount" style={inputStyle} /><br />

          <label>Payment Mode:</label><br />
          <select name="mode" style={inputStyle}>
            <option value="upi">UPI</option>
            <option value="cash">Cash</option>
            <option value="bank">Bank Transaction</option>
          </select><br />

          <label>
            <input type="checkbox" name="agree" /> I confirm the information is correct.
          </label><br /><br />

          <button type="submit" style={submitStyle}>Submit</button>
        </form>
      </div>
    </div>
  );
}

export default App;
